    function getModulesFormatters() {
        $r = [];
        $modules = \DB::table('tb_module')->select('module_name')->orderBy('module_name', 'asc')->get();
        foreach($modules as $module) {
            $mname = $module->module_name;
            $gridArray = \SiteHelpers::getModuleSetting($mname, ['grid']);
            $formatters = [];
            foreach($gridArray as $field => $item) {
                $formatter = empty($item[ 'attribute']['formater']['value']) ? '' : $item[ 'attribute']['formater']['value'];
                if (!empty($formatter)) {
                    $data = [
                        "Field Name" => $field,
                        "Formatter"  => $formatter,
                    ];
                    $formatters[] = $data;
                }
            }
            if (!empty($formatters)) {
                $r[$mname] = $formatters;
            }            
        }        
        return $r;
    }
